import React, { useState, useEffect } from 'react';
import { Link, useNavigate } from 'react-router-dom';
import { FaSignOutAlt } from 'react-icons/fa';
import { ToastContainer, toast } from 'react-toastify';
import 'react-toastify/dist/ReactToastify.css';

export default function Navbar() {
  const [isAuthenticated, setIsAuthenticated] = useState(false);
  const [activeLink, setActiveLink] = useState('/'); // Manage active link state
  const navigate = useNavigate();

  useEffect(() => {
    const token = localStorage.getItem('token');
    if (token) {
      setIsAuthenticated(true);
    }
  }, []);

  const handleSignOut = () => {
    localStorage.removeItem('token');
    localStorage.removeItem('donorId');
    setIsAuthenticated(false);

    // Show success toast and redirect after it closes
    toast.success('Signout successful', {
      onClose: () => navigate('/signin') // Redirect after toast closes
    });
  };

  const handleLinkClick = (path) => {
    setActiveLink(path); // Set the clicked link as active
  };

  return (
    <div className="navbar-main">
      <div className="container">
        <div className="navbar-header">
          <button
            type="button"
            className="navbar-toggle collapsed"
            data-toggle="collapse"
            data-target="#navbar"
            aria-expanded="false"
            aria-controls="navbar"
          >
            <span className="sr-only">Toggle navigation</span>
            <span className="icon-bar"></span>
            <span className="icon-bar"></span>
            <span className="icon-bar"></span>
          </button>

          <a className="navbar-brand">
            <img src="assets/images/we donate-logo.png" alt="" />
          </a>
        </div>

        <div id="navbar" className="navbar-collapse collapse pull-right">
          <ul className="nav navbar-nav">
            <li>
              <Link
                className={activeLink === '/' ? 'is-active' : ''}
                to="/"
                onClick={() => handleLinkClick('/')}
              >
                HOME
              </Link>
            </li>
            <li>
              <Link
                className={activeLink === '/about' ? 'is-active' : ''}
                to="/about"
                onClick={() => handleLinkClick('/about')}
              >
                ABOUT
              </Link>
            </li>
            <li>
              <Link
                className={activeLink === '/gallery' ? 'is-active' : ''}
                to="/gallery"
                onClick={() => handleLinkClick('/gallery')}
              >
                GALLERY
              </Link>
            </li>
            <li>
              <Link
                className={activeLink === '/contact' ? 'is-active' : ''}
                to="/contact"
                onClick={() => handleLinkClick('/contact')}
              >
                CONTACT
              </Link>
            </li>
            {isAuthenticated ? (
              <>
                <li>
                  <Link
                    className={activeLink === '/my-donations' ? 'is-active' : ''}
                    to="/my-donations"
                    onClick={() => handleLinkClick('/my-donations')}
                    className="btn btn-primary"
                  >
                    YOUR DONATIONS
                  </Link>
                </li>
                <li>
                  <button
                    onClick={handleSignOut}
                    className="btn btn-link signout-button"
                    style={{ marginTop: '15px' }}
                  >
                    <FaSignOutAlt /> Sign Out
                  </button>
                </li>
              </>
            ) : (
              <li>
                <Link
                  className={activeLink === '/signin' ? 'is-active' : ''}
                  to="/signin"
                  onClick={() => handleLinkClick('/signin')}
                  className="btn btn-primary"
                >
                  SIGN IN
                </Link>
              </li>
            )}
          </ul>
        </div>
      </div>
      <ToastContainer /> {/* Add ToastContainer to display notifications */}
    </div>
  );
}
